import './index.css'

const Disease =(props)=>{
    const {diseasesList}=props
    return(
        <div className="disease-container">
            <h1 className='Disease-heading'>Diseases</h1>
            <ul>
                {diseasesList.map((each)=>(
                    <li className='disease-card'>
                        <img className='card-image' src={each.diseaseImg} alt='disease-image' />
                        <p className='disease-name'>{each.name}</p>
                        <button className='button'>View</button>
                    </li>
                ))}
            </ul>
        </div>
    )
}

export default Disease;
